import{_ as s,o as a,c as l,R as n}from"./chunks/framework.333b51ca.js";const h=JSON.parse('{"title":"PostgreSQL array_fill() 函数","description":"","frontmatter":{},"headers":[],"relativePath":"database/postgreSQL/ref/array_fill.md","filePath":"database/postgreSQL/ref/array_fill.md","lastUpdated":1690296072000}'),e={name:"database/postgreSQL/ref/array_fill.md"},o=n(`<h1 id="postgresql-array-fill-函数" tabindex="-1">PostgreSQL array_fill() 函数 <a class="header-anchor" href="#postgresql-array-fill-函数" aria-label="Permalink to &quot;PostgreSQL array_fill() 函数&quot;">​</a></h1><p>PostgreSQL <code>array_fill()</code> 函数返回一个填充了指定的元素的数组。</p><h2 id="array-fill-语法" tabindex="-1"><code>array_fill()</code> 语法 <a class="header-anchor" href="#array-fill-语法" aria-label="Permalink to &quot;\`array_fill()\` 语法&quot;">​</a></h2><p>这里是 PostgreSQL <code>array_fill()</code> 函数的语法：</p><div class="language-sql"><button title="Copy Code" class="copy"></button><span class="lang">sql</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">array_fill(element, demension_length[, lower_bound]) </span><span style="color:#89DDFF;">-&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#F78C6C;">array</span></span></code></pre></div><h3 id="参数" tabindex="-1">参数 <a class="header-anchor" href="#参数" aria-label="Permalink to &quot;参数&quot;">​</a></h3><ul><li><p><em><code>element</code></em></p><p>必需的。 要填充到数组的元素。</p></li><li><p><em><code>demension_length</code></em></p><p>必需的。 要返回的数组的维度和每个维度的长度。 类型： <code>integer[]</code>。 比如，<code>ARRAY[2]</code> 表示一个长度为 2 的一维数组; <code>ARRAY[2,3]</code> 表示一个二维数组，其第一维长度为 2， 其第二维长度为 3。</p></li><li><p><em><code>lower_bound</code></em></p><p>可选的。 开始填充数据的起始下标。 它应该和 <code>demension_length</code> 对应。比如 <code>ARRAY[2]</code> 表示从下标 2 开始填充一维数组; <code>ARRAY[2,3]</code> 表示从下标 2 开始填充第一维，从下标 3 开始填充第二维。默认为 <code>1</code>。</p></li></ul><h3 id="返回值" tabindex="-1">返回值 <a class="header-anchor" href="#返回值" aria-label="Permalink to &quot;返回值&quot;">​</a></h3><p>PostgreSQL <code>array_fill()</code> 函数返回一个数组，该数组的维度通过 <code>demension_length</code> 指定并且该数组填满了 <code>element</code> 元素。</p><p>如果元素 <code>element</code> 的类型是不明确的， <code>array_fill()</code> 函数将返回一个错误: ”could not determine polymorphic type because input has type unknown“。</p><h2 id="array-fill-示例" tabindex="-1"><code>array_fill()</code> 示例 <a class="header-anchor" href="#array-fill-示例" aria-label="Permalink to &quot;\`array_fill()\` 示例&quot;">​</a></h2><h3 id="一维数组" tabindex="-1">一维数组 <a class="header-anchor" href="#一维数组" aria-label="Permalink to &quot;一维数组&quot;">​</a></h3><p>本示例展示了如何使用 PostgreSQL <code>array_fill()</code> 函数获取一个填充了 <code>1</code> 的长度为 5 的一维数组。</p><div class="language-sql"><button title="Copy Code" class="copy"></button><span class="lang">sql</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#F78C6C;">SELECT</span><span style="color:#A6ACCD;"> array_fill(</span><span style="color:#F78C6C;">1</span><span style="color:#A6ACCD;">, </span><span style="color:#F78C6C;">ARRAY</span><span style="color:#A6ACCD;">[5]);</span></span></code></pre></div><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">array_fill</span></span>
<span class="line"><span style="color:#FFCB6B;">-------------</span></span>
<span class="line"><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span><span style="color:#FFCB6B;">1,1,1,1,1}</span></span></code></pre></div><p>您也可以指定数组的起始下标。比如您想要获取一个填充了 <code>1</code> 的长度为 5 且下标从 3 开始的一维数组。</p><div class="language-sql"><button title="Copy Code" class="copy"></button><span class="lang">sql</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#F78C6C;">SELECT</span><span style="color:#A6ACCD;"> array_fill(</span><span style="color:#F78C6C;">1</span><span style="color:#A6ACCD;">, </span><span style="color:#F78C6C;">ARRAY</span><span style="color:#A6ACCD;">[5], </span><span style="color:#F78C6C;">ARRAY</span><span style="color:#A6ACCD;">[3]);</span></span></code></pre></div><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">array_fill</span></span>
<span class="line"><span style="color:#FFCB6B;">-------------------</span></span>
<span class="line"><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">[</span><span style="color:#F78C6C;">3</span><span style="color:#A6ACCD;">:7</span><span style="color:#89DDFF;">]</span><span style="color:#A6ACCD;">={1,1,1,1,1}</span></span></code></pre></div><h3 id="多维数组" tabindex="-1">多维数组 <a class="header-anchor" href="#多维数组" aria-label="Permalink to &quot;多维数组&quot;">​</a></h3><p>本示例展示了如何使用 PostgreSQL <code>array_fill()</code> 函数获取一个填充了 <code>1</code> 的二维数组。</p><div class="language-sql"><button title="Copy Code" class="copy"></button><span class="lang">sql</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#F78C6C;">SELECT</span><span style="color:#A6ACCD;"> array_fill(</span><span style="color:#F78C6C;">1</span><span style="color:#A6ACCD;">, </span><span style="color:#F78C6C;">ARRAY</span><span style="color:#A6ACCD;">[3, 2]);</span></span></code></pre></div><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">array_fill</span></span>
<span class="line"><span style="color:#FFCB6B;">---------------------</span></span>
<span class="line"><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span><span style="color:#A6ACCD;">{1,1},{1,1},{1,1}}</span></span></code></pre></div><p>同样，您也可以为二维数组指定起始下标。比如：</p><div class="language-sql"><button title="Copy Code" class="copy"></button><span class="lang">sql</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#F78C6C;">SELECT</span><span style="color:#A6ACCD;"> array_fill(</span><span style="color:#F78C6C;">1</span><span style="color:#A6ACCD;">, </span><span style="color:#F78C6C;">ARRAY</span><span style="color:#A6ACCD;">[3, 2],  </span><span style="color:#F78C6C;">ARRAY</span><span style="color:#A6ACCD;">[2, 2]);</span></span></code></pre></div><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">array_fill</span></span>
<span class="line"><span style="color:#FFCB6B;">--------------------------------</span></span>
<span class="line"><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">[</span><span style="color:#F78C6C;">2</span><span style="color:#A6ACCD;">:4</span><span style="color:#89DDFF;">][</span><span style="color:#F78C6C;">2</span><span style="color:#A6ACCD;">:3</span><span style="color:#89DDFF;">]</span><span style="color:#A6ACCD;">={{1,1}</span><span style="color:#FFCB6B;">,</span><span style="color:#A6ACCD;">{1,1}</span><span style="color:#FFCB6B;">,</span><span style="color:#A6ACCD;">{1,1}</span><span style="color:#FFCB6B;">}</span></span></code></pre></div><p>使用 PostgreSQL <code>array_fill()</code> 函数生成一个三维数组也是可能的。比如：</p><div class="language-sql"><button title="Copy Code" class="copy"></button><span class="lang">sql</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#F78C6C;">SELECT</span><span style="color:#A6ACCD;"> array_fill(</span><span style="color:#F78C6C;">1</span><span style="color:#A6ACCD;">, </span><span style="color:#F78C6C;">ARRAY</span><span style="color:#A6ACCD;">[2, 2, 2],  </span><span style="color:#F78C6C;">ARRAY</span><span style="color:#A6ACCD;">[2, 2, 2]);</span></span></code></pre></div><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">array_fill</span></span>
<span class="line"><span style="color:#FFCB6B;">-----------------------------------------------</span></span>
<span class="line"><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">[</span><span style="color:#F78C6C;">2</span><span style="color:#A6ACCD;">:3</span><span style="color:#89DDFF;">][</span><span style="color:#F78C6C;">2</span><span style="color:#A6ACCD;">:3</span><span style="color:#89DDFF;">][</span><span style="color:#F78C6C;">2</span><span style="color:#A6ACCD;">:3</span><span style="color:#89DDFF;">]</span><span style="color:#A6ACCD;">={{{1,1}</span><span style="color:#FFCB6B;">,</span><span style="color:#A6ACCD;">{1,1}</span><span style="color:#FFCB6B;">},</span><span style="color:#A6ACCD;">{{1,1}</span><span style="color:#FFCB6B;">,</span><span style="color:#A6ACCD;">{1,1}</span><span style="color:#FFCB6B;">}}</span></span></code></pre></div><h3 id="元素的类型" tabindex="-1">元素的类型 <a class="header-anchor" href="#元素的类型" aria-label="Permalink to &quot;元素的类型&quot;">​</a></h3><p>如果您想使用下面的语句获取一个填充了字符 <code>x</code> 的数组：</p><div class="language-sql"><button title="Copy Code" class="copy"></button><span class="lang">sql</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#F78C6C;">SELECT</span><span style="color:#A6ACCD;"> array_fill(</span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">x</span><span style="color:#89DDFF;">&#39;</span><span style="color:#A6ACCD;">, </span><span style="color:#F78C6C;">ARRAY</span><span style="color:#A6ACCD;">[3, 2]);</span></span></code></pre></div><p>您会收到一个错误提示：”无法确定多态类型, 因为输入类型为 unknown“。</p><p>您需要对 <code>x</code> 提供一个准确的类型：</p><div class="language-sql"><button title="Copy Code" class="copy"></button><span class="lang">sql</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#F78C6C;">SELECT</span><span style="color:#A6ACCD;"> array_fill(</span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">x</span><span style="color:#89DDFF;">&#39;</span><span style="color:#A6ACCD;">::</span><span style="color:#C792EA;">TEXT</span><span style="color:#A6ACCD;">, </span><span style="color:#F78C6C;">ARRAY</span><span style="color:#A6ACCD;">[3, 2]);</span></span></code></pre></div><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">array_fill</span></span>
<span class="line"><span style="color:#FFCB6B;">---------------------</span></span>
<span class="line"><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span><span style="color:#A6ACCD;">{x,x},{x,x},{x,x}}</span></span></code></pre></div>`,35),p=[o];function t(c,r,i,C,y,d){return a(),l("div",null,p)}const F=s(e,[["render",t]]);export{h as __pageData,F as default};
